class MiComponente extends Component{

    render(){
        let receta = {
            nombre:'Pizza',
            ingredientes: ['Tomate', 'Queso','Masa','Jamon'],
            calorias: 400
        };
        return(
            <h1>Holi soy el componente</h1>
        );
    }

}

export default MiComponente;
